import React from 'react';

const RoleList = (props) => {
    if (props["clashteam"]["players"] != undefined) {
        return (
            <div className="rowC midroles">
                {props["clashteam"]["players"].map((value, index) => <h1 key={index}>{value.name}</h1>)}
            </div>
        );
    }
    else return (<div></div>);
}

export default RoleList;
